import { BrowserRouter, Routes, Route } from "react-router-dom"
import './App.css';
import Dashboard from "./pages/Dashboard.jsx"

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path="/dashboard" element={<Dashboard/>} />
        </Routes>
      </BrowserRouter>
     Hello
    </div>
  );
}

export default App;
